import React, { useState, useEffect } from 'react';

export const Standings = () => {
  const [error, setError] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);
  const [teams, setTeams] = useState([]);

  useEffect(() => {
    fetch('https://api.sleeper.app/v1/league/863187571134541824/rosters')
      .then((res) => res.json())
      .then(
        (result) => {
          console.log('this is standings', result);
          setIsLoaded(true);
          setTeams(result);
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          setIsLoaded(true);
          setError(error);
        }
      );
  }, []);

  useEffect(() => {
    fetch('https://api.sleeper.app/v1/league/863187571134541824/users')
      .then((res) => res.json())
      .then(
        (result) => {
          setIsLoaded(true);
          setMembers(result);
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          setIsLoaded(true);
          setError(error);
        }
      );
  }, []);

  let standings = teams.sort((a, b) => b.settings.wins - a.settings.wins);
  console.log('ordered standings', standings);

  return (
    <div>
      <h1>Fantasy N' Chill Members</h1>
      <ul>
        {standings.map((team) => (
          <div key={team.id}>
            <h3>{team.settings.wins}</h3>
          </div>
        ))}
      </ul>
    </div>
  );
};
